export async function fetchApi(letter, ingredient) {
  try {
    const url = `https://www.themealdb.com/api/json/v1/1/filter.php?${letter}=${ingredient}`;
    const response = await fetch(url);
    const data = response.json();
    return data;
  } catch (error) { console.log(error); }
}
